'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class SendLimitOrderForOrderCommand extends SendSingleCommandWithoutResponse {
    limitOrderRequest;
    order;
    constructor() {
        super();
        this.commandName = "SendLimitOrderForOrderCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createLimitOrderForOrderRequestMessage(this.tradingSession, this.limitOrderRequest, this.order, this.requestNumberGenerator, stdlib.nowutc());
    }
}
module.exports = SendLimitOrderForOrderCommand
